import { AuthUserContext } from '../Session';
import { withAuthentication } from '../Session';
import { compose } from 'recompose';

var hi = "";
const Home3 = () => 
  <AuthUserContext.Consumer>
  {authUser = () =>
  {
    hi = authUser.email;
  }
  }
  <div>

  </div>
</AuthUserContext.Consumer>

const Home2 = () => (
  withFirebase(Home)
)
class Homee extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: null
    };
  }
  render()
  {
    hi = "hello";
    return (
      <div>
       {hi}
      </div>
    )
  }
}
const Home = () => (
  <div>
    hi
  </div>
)

export default Homee;
